            body:
                "---\n\n<center>![](https://steemitimages.com/DQmXZhfbdGqzDxWReYdNKxf4ueHDxeQaoqd1udAxUGvtRF4/image.png)</center>\n<center><sup>ibauman.ca</sup></center>\n\n<br>\n### <center>JUDGE ME NOT!</center>\n<br>\n\n<center>I was once a lad,</center>\n<center>Full of dreams & Hopes that I wanted to grab.</center>\n<center>Happy thoughts & unforgettable memories,</center>\n<center>In my heart will always be cherished.</center>\n<br>\n<center>Sad story you may tell,</center>\n<center>How I got here stuck in a shell.</center>\n<center>But you dont know my true story,</center>\n<center>How my life ended in this journey.</center>\n<br>\n<center>I tried it all! I didn't gave up the fight!</center>\n<center>I fought so hard! Until I lost my sight!</center>\n<center>With just one blew of mother nature,</center>\n<center>It all darkened my future.</center>\n<br>\n<center>I tried it all! I tried it all!</center>\n<center>But what else can I do if it's mother nature's call?</center>\n<center>I tried it all! I tried it all!</center>\n<center>But what else can I do if I had the hardest fall?</center>\n<br>\n<center>My story may be forgotten,</center>\n<center>A loser like me who's dreams have fallen.</center>\n<center>I am sorry! That is all I got!</center>\n<center>Please! Judge me not!</center>\n<br>\n\n---\n\n<br>\n*Hi everyone!*\n\n*I would like to join a poetry contest and above is my entry.*\n<br>\n\n---\n\n## You may want to read some of my articles\n\n---\n\n- [TALKS/OPINION: Toyota Is Planning To Create A Robot Pod Van(Self Driving Vehicle) & Uber](https://steemit.com/technology/@coinbelly/talks-opinion-toyota-is-planning-to-create-a-robot-pod-van-self-driving-vehicle-and-uber)\n\n- [TALKS/OPINION: Is There A Way To FIx The Volatility Of Digital Money?](https://steemit.com/cryptocurrency/@coinbelly/talks-opinion-is-there-a-way-to-fix-the-volatility-of-digital-money)\n\n- [TALKS/OPINION: Did You Know That There Are 2 Latest Hardware Bugs That Can Affect Most of Devices? Security Keys Vulnerability.](https://steemit.com/cryptocurrency/@coinbelly/talks-opinion-did-you-know-that-there-are-2-latest-hardware-bugs-that-can-affect-most-of-devices-security-keys-vulnerability)\n\n- [TALKS/OPINION: Does Crypto Malware Miners Attacking Advertising Network?](https://steemit.com/cryptocurrency/@coinbelly/talks-opinion-does-crypto-malware-miners-attacking-advertising-network)\n\n- [TALKS/OPINION: Did The Bitcoin Future Fails?](https://steemit.com/bitcoin/@coinbelly/talks-opinion-did-the-bitcoin-future-fails)\n\n- [TALKS/OPINION: Crypto Price Analysis](https://steemit.com/bitcoin/@coinbelly/talks-opinion)\n\n<center>![upvote follow and resteem SQUARE.gif](https://steemitimages.com/DQmb2XLRnqy5netJri1pMXwqxB22MxujE4XakYcHeVUpQqx/upvote%20follow%20and%20resteem%20SQUARE.gif)</center>\n\n---\n\n<center>https://steemitimages.com/0x0/https://steemitimages.com/DQmP4BHPBRSeXvRs6vq3gYCw2mkhY9N7yK9x4b6m13uPELP/image.png</center>\n\n---\n\n<center>@thealliance @dropahead @qurator</center>\n<center>@cejero021</center>",
