            title: 'Her Thirties   Part 13',
            body:
                '<br><br><center>![vintage-1061569_1280.jpg](https://steemitimages.com/DQmeRxj8u2RetuRWa6AWYQvran1HomTftfNf3Gh5jzTYhZT/vintage-1061569_1280.jpg)\n"Sam" Samantha Ellis</center>\n\n\n\n\n\n\n\n\n<br><br>The following morning, I lay in bed taking my time waking up. I was in no hurry‚Äîit was Sunday and was going to be another spring-like day. I could already feel the warmth of the sun radiating through the venetian blinds.\n\nI always leave the blinds open at night, so I can watch the stars‚Äîthat‚Äôs another thing Sam hated‚Äîshe needed complete darkness and a shut door.\n\nAs I lay there taking mental inventory of our differences, my cell phone began vibrating and ringing on the night table beside my bed. I reached over and picked up.\n\n<br><br> ‚ÄúYou‚Äôre still in bed, aren‚Äôt you?‚Äù\n\nIt was Cam Stewart, my best friend since high school. Just hearing his soft, sincere voice served to remind me how everyone in my life seemed my polar opposite‚Äîwhy was that?\n\n‚ÄúHey Cam. I‚Äôm awake‚Äîjust not out of bed yet.‚Äù\n\n‚ÄúDon‚Äôt tell me you were out on a hot date last night.‚Äù\n\n‚ÄúOkay, I won‚Äôt.‚Äù\n\n‚ÄúNo, c‚Äômon seriously. How do you do that? You just broke up with Sam.‚Äù\n\n‚ÄúI wasn‚Äôt out with a girl.‚Äù\n\n‚ÄúOh. Should I be concerned?‚Äù\n\n‚ÄúVery funny. I was at the hockey game.‚Äù\n\n\n<br><br>I could hear him breathing as he pondered that bit of news.\n\n‚ÄúYou‚Äôre serious‚Äîyou got tickets to the Leafs-Flyers game last night?‚Äù\n\n‚ÄúA friend got them‚ÄîGolds‚Äîand so I paid for our meal in the Air Canada Club Restaurant.‚Äù\n\n‚ÄúSome guys have all the luck.‚Äù\n\n‚ÄúYeah, I suppose breaking up with Sam qualifies.‚Äù\n\n\n\n<br><br> Cam got all earnest, ‚ÄúWell, maybe not that‚Äîsorry, if I touched a sore spot, but, I‚Äôve got glad tidings that will cheer you up.‚Äù\n\n‚ÄúHow‚Äôs that?‚Äù\n\n‚ÄúYou know how Nettie‚Äôs always shopping on Kijiji? Well, she came across an ad for Thirties memorabilia. She phoned the woman and made an appointment to see her treasure trove at one o‚Äôclock this afternoon.‚Äù\n\n‚ÄúNo kidding!‚Äù\n\n‚ÄúShe actually did it for you, figuring you‚Äôd be interested.‚Äù\n\n‚ÄúI sure am‚Äîwhere is it?‚Äù\n\n‚ÄúIn the Bloor-West Village area.‚Äù\n\n‚ÄúGreat! Why don‚Äôt you come along and I‚Äôll treat you to brunch at the Bloor-Jane Restaurant.‚Äù\n\n‚ÄúSounds good. I‚Äôll pick you up in half an hour.‚Äù\n\nI leapt out of bed and headed to the shower. The day might not be a total loss after all.\n\n\n\n<br><br> A half hour later, Cam was buzzing up from the lobby. I glanced at the grandfather clock on my way out and it said ten-thirty‚Äîthere was lots of time to spare.\n\n‚ÄúApparently this woman‚Äôs great-aunt died,‚Äù Cam said, as he navigated through traffic, ‚Äúand she found all these mementoes in the attic‚Äîmostly concerning people she doesn‚Äôt know.‚Äù\n\n‚ÄúI get it‚Äîso, no attachment, eh?‚Äù\n\nCam shrugged. ‚ÄúI suppose it‚Äôs just old junk to her.‚Äù\n\nI chuckled, ‚Äúyou know, that‚Äôs what McLuhan said about antiques‚Äîjust other generations‚Äô junk.‚Äù\n\nHe frowned doubtfully,‚Äù I suppose‚Äînever thought of it that way, though.‚Äù\n\n<br><br> I smiled inwardly at Cam‚Äôs guarded response. I recalled the day he showed me his family coat of arms, the heraldic shield and the motto that suited him to a T: *abudans cautela non nocet‚Äîone can never be too careful*‚Äîthat was certainly Cam.\n\nBy the time we got to the diner, it was packed. I loved eating here because it had a retro feel. It actually was a 1950‚Äôs diner and the giant cash register looked original‚Äîlike an old Enigma machine.\n\nIt‚Äôs strange how everything I do is usually related to the past‚Äîeven right down to where I eat breakfast.\n\n<br><br> The waitress seated us by the window and we ordered the usual lunch pail breakfast favored by the construction workers who frequent the place‚Äîscrambled eggs, sausage, and rye toast‚Äîand of course, fried potatoes.\n\nWe both added chocolate milk shakes and weren‚Äôt disappointed‚Äîthey arrived in a huge fluted glass, along with the remainder of the shakes served in two, cold silver blending vessels.\n\nLife was good.\n\nI smiled and Cam smiled back at me, wiping chocolate shake from his upper lip.\n\n<br><br> ‚ÄúDid you know my dad used to hang out here as a teenager?‚Äù I chirped.\n\nHe looked surprised. ‚ÄúThis place was around in the Happy Days Era? That‚Äôs cool.‚Äù\n\n‚ÄúYeah. My dad used to sit at a booth and each one had wall-mounted Wurlitzers that were little coin-operated juke boxes.‚Äù\n\n‚ÄúNow, those would fetch a pretty penny nowadays‚Äîpeople are really into vintage stuff.‚Äù\n\n‚ÄúI suppose so.‚Äù\n\nI don‚Äôt know why Cam‚Äôs remark depressed me‚Äîthen, I remembered‚Äîit all came back.\n\nSam standing in my kitchen telling me she made a mint off nostalgia freaks like me. I suddenly lost my appetite.\n\n\n\n<br><br><center>To be continued...</center>\n<br><br><center>¬© 2017, John J Geddes. All rights reserved</center>\n<br><center>[Photo](https://pixabay.com/en/vintage-classic-lady-art-collage-1061569/)</center>\n\n<center>[Part 1 - 5](https://johngeddes.ca/her-thirties-2/)</center>\n<center>[Part 6](https://steemit.com/writing/@johnjgeddes/her-thirties-part-six)</center>\n<center>[Part 7](https://steemit.com/writing/@johnjgeddes/her-thirties-part-seven)</center>\n<center>[Part 8](https://steemit.com/writing/@johnjgeddes/her-thirties-part-eight)</center>\n<center>[Part 9](https://steemit.com/writing/@johnjgeddes/her-thirties-part-nine)</center>\n<center>[Part 10](https://steemit.com/writing/@johnjgeddes/her-thirties-part-ten)</center>\n<center>[Part 11](https://steemit.com/writing/@johnjgeddes/her-thirties-part-11)</center>\n<center>[Part 12](https://steemit.com/writing/@johnjgeddes/her-thirties-part-12)</center>\n\n<br><br>',
