            title: 'Casascius Physical Bitcoins Part 2 (latest Coins)',
            body:
                'If you read my previous article [Casascius Physical Bitcoins Part 1 (2011 Coins)](https://steemit.com/bitcoin/@nathansenn/casascius-physical-bitcoins-part-1-2011-coins) this is the continuation to it.\n\nCasascius Bitcoins are worth real digital bitcoins. One side has a hologram and underneath the hologram layer is a private key. \n\n\n### Casascius Physical Bitcoin Series 2 1 BTC 2012\n![b.png](https://steemitimages.com/DQmfLF3mrtaUo1pj2WPrfx3w1tj53erWgW5tJ4RXhbR8JbQ/b.png)\n\n\nThis coin is identical to the 2011 version, except the year ‚Äò2012‚Äô is displayed on the front and it is a solid brass coin.  Each 1-bitcoin coin is about (28.5mm) in diameter and weighs 6.8 g. \nA significant number (nearly a fourth) of these coins have been redeemed, most likely as a direct result of the dramatic rise in bitcoin value in late 2013.\n\n### Casascius Physical Bitcoin Series 2 1 BTC 2013\n![b-2.png](https://steemitimages.com/DQmZZEVcJCSVG3iwZUSXfqg1Y7jfqbVALZhuyK55qdFaa2T/b-2.png)\n\n\n1 BTC brass physical Bitcoin with Series-2 hologram. This coin is fully loaded, unredeemed, with hologram intact. Ungraded, uncirculated in excellent condition, kept in a container at all times. This coin was the first to have a ‚Äòlobe‚Äô cut into the private key pit in order to help stabilize the private key.\n\n\n\n\n\n### Casascius Physical Bitcoin Series 3 1 BTC 2013\n![b-3.png](https://steemitimages.com/DQmddDCGfhjyPTENHTrGtMS3yKPu59THTPbjnFDuBRYJAkB/b-3.png)\n\nThis 1 BTC coin .999 silver is the ‚Äòlaser rimming‚Äô which appears on the edges of the series 3 hologram as a golden texture is about (39 mm) in diameter and weighs 1 oz. Only 5 intended to produce 5 BTC silver coins, but though the mold was created, the plan was scrapped in favor of 1 BTC, 0.5 BTC, and 0.1 BTC series 3 silver coins due to the ‚ÄúRise in the Bitcoin price  from $1 to $140 USD. \n\n### Casascius Physical Bitcoin Series 3 1 BTC 2013 ‚ÄòGold Rim‚Äô\n![b-5.png](https://steemitimages.com/DQmangMTBP9RcT2uCkGRnQC7JZ753JuXnwtWQ3ggtSAuMgV/b-5.png)![b-4.png](https://steemitimages.com/DQmRC7YtkHvsFcXZHtKm3TC3oFaF3faGvV8Xe3vDtFuR2SN/b-4.png)\n\nThis is the same as the original series 3 1 BTC 2013 coin, but with a solid gold plating applied to the ‚ÄòB‚Äô and the outer rim on both sides. This plating is of a higher quality than that of the series 2 10 BTC 2012 ‚ÄòGold B‚Äô coins. 700 of series 3 1 BTC 2013 coin of which 2,000*  were originally made converted to  to this ‚ÄòGold Rim‚Äô version. *20 of these 2,000 coins have been opened. \n\n\n\n\n\n\n\n\n### Casascius Physical Bitcoin Series 1 5 BTC 2012 ‚ÄòError Bitnickel‚Äô\n![b-6.png](https://steemitimages.com/DQmY29ifTDUDjPSB5ZkWHERhvPsGX7LwECgYR9jfh2NnR8a/b-6.png)\n\n\n2012 Casascius 5 BTC NICKEL PL. BRASS (Series 1) Physical Bitcoin with 1 hologram was priced at 6 BTC. All 5 BTC coins appear to have signs of wear on the ‚ÄòS‚Äô,‚ÄòI‚Äô, ‚ÄòN‚Äô, ‚ÄòE‚Äô, ‚ÄòR,‚Äô and ‚ÄòI‚Äô of the ‚ÄòVires In Numeris‚Äô motto, seemingly created in the minting process.\n\nCasascius later released an unknown number of 40- coin rolls without holograms as blanks, identifying them as ‚ÄòRoll Your Own‚Äô.\n\n### Casascius Physical Bitcoin Series 2 5 BTC 2012 ‚ÄòBitnickel‚Äô\n![b-7.png](https://steemitimages.com/DQmNfab2LjexE2DRwLmVrVCN7cE8HThFayo4VgMybfNmMuK/b-7.png)![b-8.png](https://steemitimages.com/DQmSr7U4H741LtUYvz9Xb93zyfuRbgRvF8vemcga8gDksW4/b-8.png)\n\n\nThis is the ‚Äòtrue‚Äô Bitnickel featuring a silver (or nickel) tone hologram. The only nickel Casascius, and has a rare issue with green color firstbits. \n\n\n\n\n\n\n\n\n\n\n\n\n### Casascius Physical Bitcoin Series 3 0.1 BTC 2013\n![b-9.png](https://steemitimages.com/DQmdXFzFnGPLEjGTc94XQ4yQBQzmrnkDKMiXAkPand8ygFc/b-9.png)\n\n\nThe top of being the smallest  and last denomination Casascius coin. The coin uses the same size hologram as the series 3 0.5 BTC coin, but lacks ‚Äòlaser rimming‚Äô which the series 3 1 BTC coin features.\n\n\n### Casascius Physical Bitcoin Series 2 0.5 BTC 2013\n![b-10.png](https://steemitimages.com/DQmQQHxrRXaT2njke7vzUd3eVmz4kVhzg5sjCrwd2AGrZYS/b-10.png)![b-11.png](https://steemitimages.com/DQmep6sU2sqYfqbroo9qQaLUiySJRJ3aMVL28ybzpGAmZMw/b-11.png)\n\n\nOn February 17, 2013, Casascius released these coins saying ‚ÄúThis is being added due to the rise in bitcoin value‚Äù and there is ‚Äòlobe‚Äô on the private key and its pit to ensure correct positioning.\n\n\n\n\n\n\n\n\n\n\n\n\n### Casascius Physical Bitcoin Series 2 0.5 BTC 2013 ‚ÄòVoid Coin‚Äô\n![b-12.png](https://steemitimages.com/DQmc1tpqBxzdrWDyCbNQZqU5xoscowDuxsg8JPdetqXSeGs/b-12.png)\n\nThese  roughly 12  coins were given out to the press as gifts. They are different than typical 0.5 BTC Brass coins in that they have no public or private key, but instead display a repeating ‚ÄúVOID‚Äù in the window. These were shown in the movie The Rise and Rise of Bitcoin. The producer, Ben Bledsoe, from the movie owned this coin.\n\n### Casascius Physical Bitcoin Series 2 0.5 BTC 2013 ‚ÄòSilver Error‚Äô\n![b-13.png](https://steemitimages.com/DQmPdxD4wr4Pzw9Qf5sfuMVuJYdmSjLaZyMnBGGPEQvcmre/b-13.png)\n\n\nThe coins were created to avoid wasting leftover series 2 holograms and were sold in rolls of 12. Only two out of all silver 0.5 BTC coins are known to have been opened.\n\n\n\n### Casascius Physical Bitcoin Series 3 0.5 BTC 2013\n![b-15.png](https://steemitimages.com/DQmTZa3FXgHLBBqxW17zZJK4tAHW6vyNsozQituPMhJJYap/b-15.png)![b-14.png](https://steemitimages.com/DQmPDpvqRRZkQthYd6YwzMqVNN9VRUYRW1eNRgr4gZ362KE/b-14.png)',
